css:
@-moz-document domain("goodblox.xyz") {
body {
    background: url(http://web.archive.org/web/20110718144709im_/http://www.roblox.com/images/cssspecific/rbx2/bkg.jpg) top center repeat-x #000444;
}
#Banner {
    position: relative;
    margin: 0;
    padding: 0;
    height: 195px;
    background: url(http://web.archive.org/web/20110718211122im_/http://www.roblox.com/images/cssspecific/rbx2/head_03.jpg) repeat scroll 0 0 transparent;
    background-position: 0 0;
    background-repeat: no-repeat;
    z-index: 6;
    border: none;
    width: 910px;
}
#Header {
    border-top: none;
}
#Options div {
    margin: 0;
    height: 28px;
    margin-top: 90px;
    font-family: Arial,Helvetica,sans-serif;
    font-size: 12px;
    font-weight: normal;
    color: Black;
    float: left;
    background: url(http://web.archive.org/web/20110718144709im_/http://www.roblox.com/images/cssspecific/rbx2/head_bkg_t1.png) no-repeat left top, url(http://web.archive.org/web/20110718144709im_/http://www.roblox.com/images/cssspecific/rbx2/head_bkg_t2.png) no-repeat scroll right top transparent;
    padding: 0 0 0 2px;
}
#Options div a {
    height: 18px;
    background: url(http://web.archive.org/web/20110718144709im_/http://www.roblox.com/images/cssspecific/rbx2/btn_blue18h.png) repeat-x;
    background-position: 0 0;
    margin: 0 5px;
    font-weight: bold;
    font-size: 10px;
    padding: 2px 5px;
}
#Options div a:hover {
    background-position: 0 -18px;
    text-decoration: none;
}
#Header .Navigation {
    border: none;
    height: 30px;
    background: url(http://web.archive.org/web/20110718144709im_/http://www.roblox.com/images/cssspecific/rbx2/topNav_blue.png);
    background-position: 0 0;
    text-align: center;
    font-size: 12pt;
    line-height: 20px;
    width: 910px;
}
#Header .Navigation .Separator {
    display: none;
}
#Header .Navigation .MenuItem:hover {
    background: url(http://web.archive.org/web/20110718144709im_/http://www.roblox.com/images/cssspecific/rbx2/topNav_blue.png);
    background-position: 0 30px;
    height: 30px!important;
    text-decoration: none;
    padding-bottom: 5px;
}
#Header .Navigation .MenuItem {
    height: 30px!important;
    position: relative;
    padding-bottom: 5px;
    float: none;
    padding-left: 7px;
    padding-right: 7px;
    top: -5px;
}
#Logo img {
    display: none;
}
#Banner #Alerts #AlertSpace {
    float:right;
    border:none;
    margin-left:0;
    position: relative;
    margin-right:0;
    background:url(http://web.archive.org/web/20110804032525im_/http://www.roblox.com/images/cssspecific/rbx2/head_sign.png) 0 0;
    height: 71px;
    width: 127px;
    top: 111px;
    right: 62px;
}
#Body {
    background: url(http://web.archive.org/web/20110718144709im_/http://www.roblox.com/images/cssspecific/rbx2/containerBkg_01.png);
    padding-left: 5px;
    padding-right: 5px;
    margin: 0px;
    padding-top: 10px;
}
.SignUpAndPlay img {
    content: url("http://web.archive.org/web/20110804032426im_/http://www.roblox.com/images/Holiday3Button.png");
}
#Banner .SignUpAndPlay {
    margin-top: 90px;
    margin-left: 73px;
    display: block;
}
#Footer {
    background: #e6e6e6;
    margin-top: 0px;
    padding: 3em 20px;
    width: 870px;
}
#NewsFeed img {
    content: url("http://web.archive.org/web/20110713195853im_/http://www.roblox.com/images/cssspecific/rbx2/topNav_rss.png");
}
}

@-moz-document url-prefix("https://goodblox.xyz/forum/") {
th {
    background-color: #6e99c9;
    background-image: none;
}
td.forumHeaderBackgroundAlternate {
    background-image: none;
    background-color: #BDD6F5;
}
td.forumRowHighlight {
    background-color: #dfe9fc;
}
.CenterColumn a {
    color: #0000FF;
}
}
